// export default Dashboard/

import React, { useEffect } from 'react';
import styled from 'styled-components';
import { useGlobalContext } from '../../context/globalContext';
import History from '../../History/History';
import { InnerLayout } from '../../styles/Layouts';
import { dollar } from '../../utils/Icons';
import Chart from '../Chart/Chart';

function Dashboard() {
    const { totalExpenses, incomes, expenses, totalIncome, totalBalance, getIncomes, getExpenses } = useGlobalContext();

    useEffect(() => {
        getIncomes();
        getExpenses();
    }, []);

    return (
        <DashboardStyled>
            <InnerLayout>
                <h1>All Transactions</h1>
                <div className="stats-con">
                    <div className="chart-con">
                        <Chart />
                        <div className="amount-con">
                            <div className="income">
                                <h2>Total Income</h2>
                                <p>Rs {totalIncome()}</p>
                            </div>
                            <div className="expense">
                                <h2>Total Expense</h2>
                                <p>Rs {totalExpenses()}</p>
                            </div>
                            <div className="balance">
                                <h2>Total Balance</h2>
                                <p>Rs {totalBalance()}</p>
                            </div>
                        </div>
                    </div>
                    <div className="history-con">
                        <History />
                        <h2 className="salary-title">
                            Min <span>Income</span> Max
                        </h2>
                        <div className="salary-item">
                            <p>Rs {Math.min(...incomes.map((item) => item.amount))}</p>
                            <p>Rs {Math.max(...incomes.map((item) => item.amount))}</p>
                        </div>
                        <h2 className="salary-title">
                            Min <span>Expense</span> Max
                        </h2>
                        <div className="salary-item">
                            <p>Rs {Math.min(...expenses.map((item) => item.amount))}</p>
                            <p>Rs {Math.max(...expenses.map((item) => item.amount))}</p>
                        </div>
                    </div>
                </div>
            </InnerLayout>
        </DashboardStyled>
    );
}

const DashboardStyled = styled.div`
    .stats-con {
        display: grid;
        grid-template-columns: repeat(5, 1fr);
        gap: 2rem;

        .chart-con {
            grid-column: 1 / 4;
            height: 300px;

            .amount-con {
                display: flex;
                grid-template-columns: repeat(3, 1fr); /* Updated to 3 items per row */
                gap: 1rem;
                margin-top: 1rem;

                .income,
                .expense,
                .balance {
                    grid-column: span 1;
                    background: #fcf6f9;
                    border: 2px solid #ffffff;
                    box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.06);
                    border-radius: 20px;
                    padding: 1rem;
                    justify-content: center;
                    align-items: center;
                    p {
                        font-size: 3.0rem;
                        font-weight: 700;
                    }
                }

                .balance {
                    grid-column: span 2; /* Spanning 2 columns */
                    display: flex;
                    flex-direction: column;
                    justify-content: center;
                    align-items: center;

                    p {
                        color: #6675fa;
                        opacity: 1;
                        font-size: 3.0rem;
                    }
                }
            }
        }

        .history-con {
            grid-column: 4 / -1;

            h2 {
                margin: 1rem 0;
                display: flex;
                align-items: center;
                justify-content: space-between;
            }

            .salary-title {
                font-size: 1.2rem;

                span {
                    font-size: 1.8rem;
                }
            }

            .salary-item {
                background: #fcf6f9;
                border: 2px solid #ffffff;
                box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.06);
                padding: 1rem;
                border-radius: 20px;
                display: flex;
                justify-content: space-between;
                align-items: center;

                p {
                    font-weight: 600;
                    font-size: 1.6rem;
                }
            }
        }
    }
`;

export default Dashboard;
